description.text:
A stick figure dragon modeled with the inspiration as being a toy-like-thing as well as a piece of art.  The dragon and the base are two separate parts but should connect to make the dragon stand up after printing if the size ratios are kept the same.  
The base has been updated here and in it's own design on my &quot;Designs&quot; page.
ART 297 - Project 4 and 5: &quot;Artist Toys + Toy-Like Things&quot;
